function TileBuilder(tiles,rowWidth){
	row=0;		
	for(i=0;i<tiles.length;i++){
		if (i==rowWidth*(row+1)){
			row++
		}
		Xindex= i-row*rowWidth;
		switch(tiles[i]){
			case 0:
				break;
			case 1:				
				ground.push(temp = new Object ("images/LevelThree/L3Grass.png", Xindex*100, row*100,100,100));
				break;
		}
	}
}
    